def my_func(input1: str):
    if len(input1) < 1 or len(input1) > 100:
        return ""

    results = []
    for char in input1:
        if char.isdigit() or char.isupper():
            results.append(char)
        elif char in "!\"#$%&'()*+,-./:;<=>?@[\\]^_`{|}~":
            results.append(char)
        if len(results) >= 2:
            break
    return "".join(results)
